export async function fetchCustomers(token: string) {
  try {
    const res = await fetch("http://localhost:8080/admin/customers/all", {
      method: "GET",
      headers: {
        Authorization: token,
        "Content-Type": "application/json",
      },
      mode: "cors",
    });
    const data = await res.json();
    return data;
  } catch (error) {
    console.log(error);
  }
}

